import React from 'react'
import Logo from './../img/Sabor_Badalona.png';
import { Link } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';
const handleDestroySession = () => {
  sessionStorage.removeItem('username');
  sessionStorage.removeItem('role');
  window.location.href = '/loginUser';
};
export default function NavbarElement() {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand>
          <Link to="/" className="text-decoration-none">
            <img src={Logo} alt="Logo" width="60" className="rounded-circle me-2 img-fluid w-40" />
            <span className="text-decoration-none fs-4 text-black">Cool kids club</span>
          </Link>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbar-nav" />
        <Navbar.Collapse id="navbar-nav">
          <Nav className="ms-auto">
            {sessionStorage.getItem("username") && (
              <Nav.Link as={Link} to="/SearchFriends">
                Search Friends
              </Nav.Link>
            )}
            {!sessionStorage.getItem("username") && (
              <Nav.Link as={Link} to="/loginUser">
                Sign In
              </Nav.Link>
            )}
            {sessionStorage.getItem("username") ? (
              <Nav.Link onClick={handleDestroySession}>
                Log Out
              </Nav.Link>
            ) : (
              <Nav.Link as={Link} to="/adduser">
                Make an Account
              </Nav.Link>
            )}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  )
}
